import React, { useState, useEffect } from 'react';
import { GetDataChannel } from "../service/connector/youtube"


const Video = async ({content}) => {

    useEffect(async () => {
      GetDataChannel('spacex').then(content => console.log(content)) 
    });

    return <div>{
        content
    }</div>
}

export default Video
